function myMain() {
  var dnaseq, basep;
  var chars = [];
  var bp1, bp2;
  var count=0;
  dnaseq = prompt("What DNA sequence? ");
  while (true) {
    basep = prompt("What base pair? ");
    if (basep==="done") { return; }

    chars = dnaseq.split("");
    bp1 = basep.charAt(0);
    bp2 = basep.charAt(1);

    count=0;
    for (var d=0; d<chars.length-1; d++) {
      if (chars[d] == bp1) { if (chars[d+1]==bp2) {  count++; } }
    }
    alert("Base pair '" + basep + "' occurs " + count + " times in DNA sequence '" + dnaseq + "'");
  }

}

