function decompose ( inString ) {
  var outString = inString.split("");
  return outString;
}

function compareString( searchString, DNAstring) {
  var counter = 0;
  for ( var i = 0; i < DNAstring.length-1; i++ ){
    if ( ( searchString.charAt(0) === DNAstring.charAt(i) ) && ( searchString.charAt(1) === DNAstring.charAt(i+1) ) ) { counter = counter + 1;}
  }
  return counter;
}

