function getGoodInput() {
  var num;
  while (true) {
    num = Number(prompt("int between 1 and 20?"));
    if (isNaN(num)) { alert("error"); continue; }
    if (!isInt(num)) { alert("error"); continue; }
    if (num<1 || num>20) { alert("error"); continue; }
    return num;  
  }
}

function isInt( n ) { return (n%1)===0; }

function genRandomInt( lo, hi ) {
  // gens random int between lo and hi inclusive each end
  var num = lo+ Math.floor(((hi-lo)+1)*Math.random());
  return num;
}

function genUniqueArray ( n, lo, hi ) {
  var k;
  var arr=[];
  for (var i=0; i<n; i++) {
    while (true) { 
      k=genRandomInt(lo,hi); 
      if (!alreadyIn(k,arr)) { break; }
    }
    arr[i]=k;
  }
  return arr;
}

function alreadyIn ( n, arr ) {
  for (var i=0; i<arr.length; i++) {
    if (arr[i]===n) { return true; }
  }
  return false;
}


